Akhir pekan telah tiba! Jika akhir pekanmu senggang, NEW ERA kasih saran game yang mungkin bisa sahabat mainkan di PC/Laptop sahabat! Yang pasti game ini ringan dan bisa dijalankan di PC/Laptop berspesifikasi rendah!

1.Rocket League
Cari game multiplayer yang ramai dimainkan, namun bukan FPS dan MOBA? Ada Rocket League, penggabungan antara sepak bola dan mobil.

Game PC ini juga terkenal sebagai salah satu benchmark hardware lama. Karena bisa dioptimalkan untuk spesifikasi rendah.

2. Left4Dead 2
Game dengan tema bertahan hidup dari sebuah zombie sempat hype. Sederet developer membuat game bertema zombie, tak terkecuali Vale dengan Left 4 Dead 2.

Game PC ini memang keluaran 2009, karena itu kini spesifikasi minimumnya tak akan memberatkan PC atau laptop kentang era sekarang.

3. Team Fortress 2
Game FPS, online multiplayer, ramai pemain, dan gratis, jawabannya Team Fortress 2. Game yang jadi cikal bakal banyak game modern.

Memberikan pertarungan seru yang dijadikan inspirasi sederet game populer ini juga termasuk game lawas Valve, namun masih ramai hingga sekarang.

4. GTA San Andreas
Masih jadi salah satu franchise Grand Theft Auto dengan story yang seru dan mendalam. Dan telah menghadirkan open world yang sangat luas.

Grand Theft Auto: San Andreas juga jadi salah satu game dengan grafis memukau, di masa awal peluncurnannya. Kini tergolong ringan untuk hardware modern.

5. Outlast
Menjadi game survival horor yang sangat populer di YouTube, Outlast ternyata bukan game PC yang cukup berat.

Game survival horor ini menceritakan seorang jurnalis yang tengah menyelidiki rumah sakit jiwa. Namun ia malah terjebak dan harus cari calan untuk menyelamatkan diri.

6. F.E.A.R
Di awal peluncurannya banyak yang menyangka hanya seperti game FPS seperti umumnya. Namun ternyata berbau supranatural di game PC ini.

Nah itu tadi saran game dari NEW ERA yang bisa kamu mainkan di akhir pekan! Kira kira mana nih yang akan sahabat mainkan? Tulis di kolom komentar ya!

